replyContent:
Hello! You can transfer your game progress from free to premium version of the game: 
1. Make sure that you are using the same Google Play authorization, and logins in both versions are equal; 
2. Save your progress in the "cloud" in DayR Survival;
3. Load the progress from the "cloud" in DayR Premium.

Hello! Please follow the steps below:
1. Be sure the game is updated to the latest version;
2. Check Google Play authorization settings on your device;
3. Check for updates and update all Google apps and services;
4. Try to turn off "Google games" then turn on it again;
5. Be sure your Internet connection is stable before launching the game.

